(window.webpackJsonp=window.webpackJsonp||[]).push([[21],{190:function(s,e){s.exports='\n                  <div class="markdown-body">\n                    <h1>Deploy to github pages</h1>\n<p>Set up <code>publicPath</code>, <code>baseHref</code> in the <strong>Custom config</strong>.</p>\n<pre><code class="language-typescript"><span class="hljs-keyword">import</span> { ProjectConfig } <span class="hljs-keyword">from</span> <span class="hljs-string">\'pri/client\'</span>;\n\n<span class="hljs-keyword">export</span> <span class="hljs-keyword">default</span> {\n  <span class="hljs-attr">publicPath</span>: <span class="hljs-string">\'/&lt;your-repo-name&gt;\'</span>,\n  <span class="hljs-attr">baseHref</span>: <span class="hljs-string">\'/&lt;your-repo-name&gt;\'</span>\n} <span class="hljs-keyword">as</span> ProjectConfig;\n</code></pre>\n<p>Then, execute <code>npm i gh-pages --save-dev</code>, and add npm scripts:</p>\n<pre><code class="language-json">"deploy": "pri build &amp;&amp; gh-pages -d dist"\n</code></pre>\n<p>Finally, execute <code>npm run deploy</code>!</p>\n<blockquote>\n<p>This is because js files will be served from <code>/&lt;your-repo-name&gt;</code> and the root path changed to <code>/&lt;your-repo-name&gt;</code> on github-pages.</p>\n</blockquote>\n\n                  </div>\n              '}}]);